import React from 'react';
import './Dashboard.css'

const Dashboard = () => {
    const headingStyle = {
        position: 'absolute',
        top: '-20px', // Adjust as needed for desired position
        left: '50%',
        transform: 'translateX(-50%)',
        fontSize: '36px',
        color:'purple' // Adjust as needed
      };

  return (
    <div className="dashboard-container">
      {/* Side Navigation */}
      <div className="sidenav">
        <a href="#">Tasks</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
        <a href="#">Link 4</a>
      </div>
      {/* Main Content */}
      <div className="main-content">
        {/* Content Goes Here */}
        <h1 style={headingStyle}>Welcome to Task Management</h1>
      </div>
    </div>
  );
};

export default Dashboard;
